import React from 'react';
import { MDBContainer, MDBNavbar, MDBNavbarBrand, MDBNavLink, MDBNavbarNav, MDBNavbarToggler, MDBCollapse, MDBNavItem, MDBMDBNavLink, MDBIcon } from 'mdbreact';
import { BrowserRouter as Router } from 'react-router-dom';
import { Link } from 'react-router-dom';
import Logo from './grc-logo.svg';


export default class Navigation extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
        collapse: false,
    };
    this.onClick = this.onClick.bind(this);
}

onClick() {
  this.setState({
      collapse: !this.state.collapse,
    });
}

render() {
  const bgPink = {backgroundColor: '#e91e63'}
  const container = {height: 1300}
  return(
    <div>
      <Router>
        <header>
          <MDBNavbar style={bgPink} dark expand="md" scrolling fixed="top">
            <MDBNavbarBrand href="/">
                <strong>Navbar</strong>
            </MDBNavbarBrand>
            <MDBNavbarToggler onClick={ this.onClick } />
            <MDBCollapse isOpen = { this.state.collapse } navbar>
              <MDBMDBNavbarNav left>
                <MDBNavItem active>
                    <MDBNavLink to="#">Home</MDBNavLink>
                </MDBNavItem>
                <MDBNavItem>
                    <MDBNavLink to="#">Features</MDBNavLink>
                </MDBNavItem>
                <MDBNavItem>
                    <MDBNavLink to="#">Pricing</MDBNavLink>
                </MDBNavItem>
                <MDBNavItem>
                  <MDBNavLink to="#">Options</MDBNavLink>
                </MDBNavItem>
              </MDBMDBNavbarNav>
              <MDBNavbarNav right>
                <MDBNavItem>
                  <MDBNavLink to="#"><MDBIcon fab icon="facebook-f" /></MDBNavLink>
                </MDBNavItem>
                <MDBNavItem>
                  <MDBNavLink to="#"><MDBIcon fab icon="twitter" /></MDBNavLink>
                </MDBNavItem>
                <MDBNavItem>
                  <MDBNavLink to="#"><MDBIcon fab icon="instagram" /></MDBNavLink>
                </MDBNavItem>
              </MDBNavbarNav>
            </MDBCollapse>
          </MDBNavbar>
        </header>
      </Router>
      <MDBContainer style={container} className="text-center mt-5 pt-5">
        <h2>This Navbar is fixed</h2>
        <h5>It will always stay visible on the top, even when you scroll down</h5>
        <br/>
        <p>Full page intro with background image will be always displayed in full screen mode, regardless of device</p>
      </MDBContainer>
    </div>
    );
  }
}
